			shellPath = /bin/sh;
			shellScript = "# Merge Script\n\n# 1\n# Set bash script to exit immediately if any commands fail.\nset -e\n\n# 2\n# Setup some constants for use later on.\nFRAMEWORK_NAME=\"BitskiUnitySDK\"\n\n# 3\n# Create fat directory\nmkdir -p ${BUILD_DIR}/${CONFIGURATION}\n\n# 4\n# Build the framework for device and for simulator (using\n# all needed architectures).\nxcodebuild -workspace BitskiUnitySDK.xcworkspace -scheme ${FRAMEWORK_NAME} -configuration \"${CONFIGURATION}\" -arch arm64 only_active_arch=no defines_module=yes -sdk \"iphoneos\"\nxcodebuild -workspace BitskiUnitySDK.xcworkspace -scheme ${FRAMEWORK_NAME} -configuration \"${CONFIGURATION}\" -arch x86_64 only_active_arch=no defines_module=yes -sdk \"iphonesimulator\"\n\n# 5\n# Remove .framework file if exists from previous run.\nif [ -d \"${BUILD_DIR}/${CONFIGURATION}/${FRAMEWORK_NAME}.framework\" ]; then\nrm -rf \"${BUILD_DIR}/${CONFIGURATION}/${FRAMEWORK_NAME}.framework\"\nfi\n\n# 6\n# Copy the device version of framework.\ncp -r \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${FRAMEWORK_NAME}.framework\" \"${BUILD_DIR}/${CONFIGURATION}/${FRAMEWORK_NAME}.framework\"\n\n# 7\n# Replace the framework executable within the framework with\n# a new version created by merging the device and simulator\n# frameworks' executables with lipo.\nlipo -create -output \"${BUILD_DIR}/${CONFIGURATION}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n\nfor POD in \"AppAuth\"\ndo\ncp -r \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${POD}/${POD}.framework\" \"${BUILD_DIR}/${CONFIGURATION}/${POD}.framework\"\nlipo -create -output \"${BUILD_DIR}/${CONFIGURATION}/${POD}.framework/${POD}\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${POD}/${POD}.framework/${POD}\" \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${POD}/${POD}.framework/${POD}\"\ndone";
			showEnvVarsInLog = 0;
		};
